      h2#t_6_1 6.1. Formatos de archivo para redes sociales

    .d-flex.flex-wrap.align-items-center.flex-lg-nowrap.mb-5
      .col-lg-5.pe-lg-4.d-flex.align-items-center.mb-4.mb-lg-0
        .bloque-texto-d.color-acento-botones.p-4.p-lg-0.container-bg-text(style="border-color: transparent")
          .bloque-texto-d__texto.mb-2
            i.fas.fa-quote-left(style="color: #FFD947")
            h4.fw-bold.text-regular Es importante elegirlos con cuidado, y, sobre todo, optimizarlos según las redes sociales que los publican
            i.fas.fa-quote-right.float-end.m-3(style="color: #FFD947")
          .bloque-texto-d__autor.w-100.mt-3
            .h5.mb-0.float-start.fw-normal Deusto (2019)
      p.col-lg-7.mb-0 Cuando se trata de redes sociales, el contenido publicado es tan importante como las imágenes asociadas a él. Las imágenes en las redes sociales definen visualmente a una persona y qué quiere transmitir a sus seguidores o clientes potenciales. Un error muy común es que las imágenes publicadas en las redes sociales por lo general tienden a pixelarse, porque Facebook y Twitter tienden a comprimir las imágenes (asegúrese de subirlas siempre en formato JPG o PNG). Apoyados de nuevo en Deusto (2019) y para tener claro los tamaños adecuados y  requeridos para las imágenes que se publicarán en las diferentes redes sociales, se presentan en la siguiente tabla:

